package datastructures;

import java.util.HashMap;

public class StringAnagram {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		String A = "";
		String B = "";
		
		
			HashMap<Character , Integer> sc = new HashMap<>();
			int oldv = 0;
			int newv =0;
			for(int i =0; i<A.length() ; i++) {
				if(sc.containsKey(A.charAt(i))) {
					 oldv = sc.get(A.charAt(i));
					 newv = oldv +1;
					 sc.put(A.charAt(i), newv);
				}
				
				else {
					sc.put(A.charAt(i), 1);
				}
			}
			
			
			for(int j =0; j<B.length(); j++) {
				if(sc.containsKey(B.charAt(j))) {
					
					if(sc.get(B.charAt(j)) > 0) {
						System.out.println(sc.get(B.charAt(j)));
					 oldv = sc.get(B.charAt(j));
					 newv = oldv - 1;
					 sc.put(B.charAt(j), newv);
				}
	               else{
//	                System.out.println("0");
	            }
	            }
				else {
//					System.out.println("0");
				}}
	      
			System.out.println("1");
	}

}
